import "./Logsig.css";
// import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import React, { useState } from "react";
import sign from "./signin.png";
import axios from 'axios';
import { Link } from 'react-router-dom';

function Mainsignin()
{
      const [email, setEmail] = useState('');
      const [username, setUserName] = useState('');
      const [password, setPassword] = useState('');
      const [confirm,setConfirmpassword] = useState('');
      const handleSubmit = (event) => {
        event.preventDefault();

      }
      const sendData= async(email)=>{
axios.post("http://localhost:8000/signup",[ email  ])}

      return (
        <>
        <div>
        <form className="form"  method="post" onSubmit={handleSubmit}>
          <h1 className="header22">SIGNUP</h1>
          <div className="flex-column">
            <label>Username</label>
          </div>
          <div className="inputForm">
            <input
             required
              placeholder="Enter your Name"
              className="input"
              type="text"
              value={username}
              onChange={(e) => setUserName(e.target.value)}
            />
          </div>

          <div className="flex-column">
            <label>Email ID</label>
          </div>
          <div className="inputForm">
            <input
             required
              placeholder="Enter your Email (clg Mail)"
              className="input"
              type="text"
              value={email}
              onChange={(e) => setEmail(e.target.value)}
            />
          </div>
          <div className="flex-column">
            <label>Password</label>
          </div>
          <div className="inputForm">
            <input
             required
              placeholder="Enter your Password"
              className="input"
              type="text"
              value={password}
              onChange={(e) => setPassword(e.target.value)}
            />
          </div>
          <div className="flex-column">
            <label>Comfirm Password</label>
          </div>
          <div className="inputForm">
            <input
             required
              placeholder="University "
              className="input"
              type="text"
              value={confirm}
              onChange={(e) => setConfirmpassword(e.target.value)}
            />
          </div>







          <button onClick={()=>{
            sendData(email);
          }}  type="button"  className="button-submit">
           Sign In
          </button>

          <div className="login">
            <p>If existing user  <Link to="/Mainlogin"><span>Login</span></Link></p>
          </div>
        </form>
        </div>



      </>);
 }




export default Mainsignin;
